Templates.template:
new sap.ui.export.ExportBase(
	{
		workbook: ${workbook}, // object
		dataSource: ${dataSource}, // object|sap.ui.model.ListBinding
		count: ${count}, // int
		fileName: "${fileName}", // string
		fileType: ${fileType} // sap.ui.export.FileType
	}
)

new sap.ui.export.ExportHandler(
	{
		XLSX: ${XLSX}, // object
		PDF: ${PDF} // object
	}
)

new sap.ui.export.util.Filter(
	"${sProperty}", // string
	{
		operator: "${operator}", // string
		value: [${value}], // string|string[]
		exclude: ${bExclude} // boolean
	},
	"${sLabel}" // string
)
